import './Map.css';
import React from 'react';

function initMap() {
    const google = window.google;

    var options = {
        zoom:15,
        center: {lat:41.507213,lng:-81.606955},
        streetViewControl: false,
        //Hide Default Google Maps Icons
        styles: [
            {
                featureType: "poi",
                elementType: "labels",
                stylers: [
                    { visibility: "off" }
                ]
            },
            {
                featureType: "transit",
                stylers: [
                    { visibility: "off" }
                ]
            }
        ]
    }
    //creates the map
    var map = new google.maps.Map(document.getElementById('map'), options);
}

const Map = () => {
    return (
        <div>
            <head>
                <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/css/bootstrap.min.css" />
                <meta charset="UTF-8" />
                <meta name="viewport" content="width-device-width, initial-scale=1.0" />
                <meta http-equiv="X-UA-Compatible" content="ie=edge" />
                <title>My Google Maps</title>
            </head>
            <body>
                <div class="well" id="studentInfo">
                    <div id="header">Your Info</div>
                    <div id="casecash">CaseCash:&nbsp;</div>
                    <div id="portswipes">Portable Swipes:&nbsp;</div>
                    <div id="mealswipes">Meal Swipes:&nbsp;</div> 
                    <div id="reviewpoints">Review Points:&nbsp;</div>
                </div>
                <div id="map"></div>
                <div id="data"></div>
            </body>
        </div>
    );
}

export default Map;
